window.bookSummaryJSON = "<p>The rules of reality have changed. All types of zombies have appeared with only one goal: Kill the living. Eric and his schoolmates must survive by adapting and growing stronger, but that's easier said than done. The undead get stronger with every passing day, and that's not even mentioning the blood moons. Even worse, the military and police seem to have disappeared. How will they acquire food? How will they survive? Find out now in this LitRPG apocalypse story.</p>"; 
